import React from 'react';

export default function SelectAnalysis() {
  return (
    <div className="container mx-auto p-8">
      <h1 className="text-3xl font-bold mb-4">분석 유형 선택</h1>
      <p>여기서 내용 / 음성 / 영상 중 원하는 분석을 선택하세요.</p>
      {/* 나중에 버튼이나 카드 UI를 넣으시면 됩니다 */}
    </div>
  );
}
